import ArticleCard from '~/components/ArticleCard';
export default {
  name: 'an_issue',
  components: {
    ArticleCard
  },

  async mounted() {
    try {
      this.issue = await this.$http.get(`issues/${this.issueId}`);
      this.loading = false;
    } catch (E) {
      this.$router.push('/archive');
    }
  },

  data() {
    return {
      loading: true,
      issue: {}
    };
  },

  computed: {
    issueId() {
      let issue = this.$route.query.issue;
      if (issue) return issue;
      this.$router.push('/archive');
    },

    articles() {
      let articles = [];
      this.issue.articles.forEach(article => {
        articles.push(...article.publications);
      });
      articles.sort((f, s) => {
        let fPages = f.pages.split('-');
        let sPages = s.pages.split('-');
        if (isNaN(parseInt(fPages[0]))) return 1;else if (isNaN(parseInt(sPages[0]))) return 1;
        return parseInt(fPages[0]) > parseInt(sPages[0]) ? 1 : -1;
      });
      return articles;
    }

  }
};
